define({"topics" : [{"title":"Fax to Email","shortdesc":"\n                  <p class=\"shortdesc\">Fax to Email feature helps you receive faxes on your smart phone or computer. Yeastar             <span class=\"ph\">Cloud PBX</span> will         convert the received fax and forward it to an extension user&apos;s email.\n                  </p>\n               ","id":"concept_w2l_g22_xdb","href":"topic\/fax_to_email.html","menu": {"hasChildren":false,},"tocID":"concept_w2l_g22_xdb-d46e13985","topics":[]},{"title":"Receive Fax through a Dedicated Trunk","shortdesc":"\n                  <p class=\"shortdesc\">You can assign one or more trunks to receive faxes, and tell your customers to send         faxes to the dedicated trunk number.\n                     \n                  </p>\n               ","id":"task_y3m_kxd_xdb","href":"topic\/receive_fax_through_a_dedicated_trunk.html","menu": {"hasChildren":false,},"tocID":"task_y3m_kxd_xdb-d46e14059","topics":[]},{"title":"Receive Fax via Fax Detection","shortdesc":"\n                  <p class=\"shortdesc\">If you want to receive calls and also receive faxes through a trunk, you can set fax         detection on your inbound route.</p>\n               ","id":"task_yzr_n12_xdb","href":"topic\/receive_fax_via_fax_detection.html","menu": {"hasChildren":false,},"tocID":"task_yzr_n12_xdb-d46e14130","topics":[]},{"title":"Edit &apos;Fax to Email&apos; Template","shortdesc":"\n                  <p class=\"shortdesc\">The PBX has a default email template for <strong class=\"ph b\">Fax to Email</strong>. You can edit the         template according to your needs.\n                  </p>\n               ","id":"task_ghr_fkv_42b","href":"topic\/edit_fax_to_email_template.html","menu": {"hasChildren":false,},"tocID":"task_ghr_fkv_42b-d46e14201","topics":[]}]});